import React, { useState } from 'react'
import ComparisonStatus from './ComparisonStatus'
import { updateTradeStatus } from '../../services/supabase'

const TradeRow = ({ trade }) => {
  const [isExpanded, setIsExpanded] = useState(false)

  const handleResolve = async () => {
    try {
      await updateTradeStatus(trade.id, 'Resolved')
    } catch (error) {
      console.error('Failed to update trade status:', error)
    }
  }

  const getCellClassName = (field) => {
    if (!trade.comparison) return ''
    return trade.comparison[field] ? 'discrepancy' : ''
  }

  return (
    <>
      <tr className={`main-row ${trade.isresolved ? 'resolved' : ''}`}>
        <td className="expand-cell">
          <button 
            className="expand-button"
            onClick={() => setIsExpanded(!isExpanded)}
            disabled={!trade.matchingTrade}
          >
            {isExpanded ? '▼' : '▶'}
          </button>
        </td>
        <td>{new Date(trade.tradedate).toLocaleDateString()}</td>
        <td>{trade.age}</td>
        <td>{trade.securitysymbol}</td>
        <td className={getCellClassName('price')}>{trade.price.toFixed(2)}</td>
        <td className={getCellClassName('quantity')}>{trade.quantity}</td>
        <td>{new Date(trade.settlementdate).toLocaleDateString()}</td>
        <td>{trade.counterparty}</td>
        <td>{trade.dtc_number}</td>
        <td>
          <ComparisonStatus 
            status={trade.comparison_status} 
            isResolved={trade.isresolved}
            exceptionReason={trade.exception_reason}
          />
        </td>
        <td>{trade.settlement_status}</td>
        <td>
          {!trade.isresolved && trade.comparison_status !== 'Matched' && (
            <button 
              onClick={handleResolve}
              className="resolve-button"
              title={trade.reject_message || ''}
            >
              Mark Resolved
            </button>
          )}
        </td>
      </tr>
      {isExpanded && trade.matchingTrade && (
        <tr className="comparison-row">
          <td></td>
          <td>{new Date(trade.matchingTrade.tradedate).toLocaleDateString()}</td>
          <td>-</td>
          <td>{trade.matchingTrade.securitysymbol}</td>
          <td className={getCellClassName('price')}>{trade.matchingTrade.price.toFixed(2)}</td>
          <td className={getCellClassName('quantity')}>{trade.matchingTrade.quantity}</td>
          <td>{new Date(trade.matchingTrade.settlementdate).toLocaleDateString()}</td>
          <td>{trade.matchingTrade.counterparty}</td>
          <td>{trade.matchingTrade.dtc_number}</td>
          <td colSpan="3">
            <div className="external-trade-info">
              <span className="external-label">External Trade Data</span>
              {trade.comparison?.details?.length > 0 && (
                <div className="discrepancy-details">
                  <span className="discrepancy-label">Discrepancies Found:</span>
                  <ul>
                    {trade.comparison.details.map((detail, index) => (
                      <li key={index}>{detail}</li>
                    ))}
                  </ul>
                </div>
              )}
              {trade.reject_message && (
                <div className="reject-message">
                  Reject Reason: {trade.reject_message}
                </div>
              )}
            </div>
          </td>
        </tr>
      )}
    </>
  )
}

export default TradeRow
